      {/* className is used bc class is a keyword in js, like class Hello extnds comp. */}
      {/* tc = text-center and f1= font 1 */}
      <h1> Hello Weebs </h1>
      {/* <p> Wellcome to React</p> */}
      
        <p> {this.props.greeting}</p>
    </div>
    );
  }
}

